INSERT INTO `page_body` (`id`, `head_cont`, `content`, `photos`) VALUES
(1, ' â€œGreat things never came from comfort zones.â€', 'Round the world, or not, returning home after youâ€™ve done extensive travel is definetely not as easy as it may sound.\r\nWhen you are back home you still have the urge to travel, even your mind says: Settle down!!!', 'userpage/1535753363family-vacation-tease-today-150829_262cf042247de167bece5b479ed1a8b2.jpg'),
(2, 'â€œIf you are always trying to be normal, you will never know how amazing you can be.â€', 'Imagine you see them just there, in front of you, from the window of your moving car, out of a sudden. The sky is green, a bit of purple and is HUGE! and it moves! Is that what it is! The nature magic: the Northern Lights or the Aurora Borealis,', 'userpage/1534790769o-SOLO-TRAVEL-facebook.jpg'),
(3, 'â€œStop worrying about the potholes in the road and enjoy the journeyâ€', 'While traveling you may imagine that you have the world at your feet, or you may consider that those who travel have it all. Read the myth and reality about travelers have it all.', 'userpage/15347907771400-ss-travel-gifts-pro-photo-shoot.web.jpg'),
(4, 'For those about to rock...', 'When you first begin pursuing your dream for around the world travel, you may find it difficult to stay motivated and focused to work through the challenges and persist for the sake of your dreams.Your friends will be going out to dinner and drinks and you will have to say no, as you are saving your money for something better. Once you start traveling you will find it so much easier because you will know and understand travel. Motivation will come just by hearing the word travel.', 'userpage/1540181865alaska-tour-operator-travel-guide-luxury-travel-canada.jpg'),
(5, 'We salute you!', 'This always re-energizes me and gets me ready to get back on the road. I might visit the beach and just lie around in the hot sun reading a book or down by the lake. It allows me to see the peaceful relaxing life I may have lying on a beach or hiking through the forest in a foreign country.', 'userpage/1535753934selecting-hotel.jpg'),
(6, 'Let there be rock!', 'I canâ€™t stop thinking about it, every day, every morning when I wake up to go to work, almost every moment of my life. It is what makes me study, run, smile, love life and work hard every single day. Iâ€™m like a drug addicted who lives to get her next doses â€“ I live to travel.', 'userpage/1540181280adventure-travel.jpg');
