(92, 19, 'london-eye.jpg', '', '', '9339_10151593296414079_1689454352_n.jpg', 'London with its traditional tourist attractions', 'Your London experience begins the moment the airplane begins its final descent into London.', 'Your London experience begins the moment the airplane begins its final descent into London. A birdâ€™s eye view of Big Ben and London Eye gives a glimpse of what this amazing city has in store for you. Most people associate London with its traditional tourist attractions like Buckingham Palace, Big Ben, St. Paulâ€™s Cathedral, Westminster Abbey, and the Tower of London. Rightly so. These famous London landmarks are symbols of Englandâ€™s rich heritage and history and stand for the might and affluence of the British Empire. But there is a lot more to London than just these attractions.\r\n\r\nLondon is one of the most expensive cities in the world and whether you like it or not, you will most certainly need to part with your cash from time to time. There are also a number of public spaces to hangout, which of course are free; lovely parks and quiet, leafy squares that can provide havens of tranquility in the midst of this busy city.\r\n\r\nAfter spending considerable amount of time in London, I can say with certainty that the best way to explore the city is by walking around. Start from the famous Trafalgar Square area and while you are there, visit the National Gallery too. Work your way towards Westminster Bridge, covering the Horse Guards Parade on the way. If time permits, stop and say hello to Mr. Prime Minister at 10 Downing Street! As you walk ahead, several mighty structures like the Westminster Abbey, Big Ben and Houses of Parliament await you. Now thatâ€™s a lot of walking and you might want to sit and relax somewhere, maybe have a nice cup of coffee at the nearest Starbucks or CafÃ© Nero.', '2018-10-26 22:48:26', '127.0.0.1'),
(93, 19, 'london-eye.jpg', '', 'DpHyg5XX4AEWilE.jpg', '', 'The London Eye', 'One of the cheapest and best things you can do in London', 'One of the cheapest and best things you can do in London is just wander around and see the sights (weather permitting). Londonâ€™s a huge city, but its centre is pretty walkable and you can see a lot within a fairly small area. One of my favourite walks is along the Thames, following Southbank from the Houses of Parliament, passing London icons like the London Eye, Tate Modern, Shakespeareâ€™s Globe, HMS Belfast and ending up at Tower Bridge.\r\nThere are also plenty of parks to explore. You can row in the Serpentine lake in Hyde Park, visit the rose garden in Regentâ€™s Park, spot the royal palaces at St Jamesâ€™ Park, take a dip in the pools on Hampstead Heath or hang out with the deer in Richmond Park. There are plenty of smaller green spaces tucked around the city too that make a good lunchtime picnic stop.\r\nThe London Eye â€“ London on a budget\r\nThe London Eye\r\nIf you want to learn more about Londonâ€™s history while you walk, several companies do free guided city walks. Sandemanâ€™s New Europe runs a 3-hour tour at 10am. 11am, 1pm and 4pm each day from Covent Garden through Westminster to the Houses of Parliament. Tours are free but just tip your guide. Or Free Tours by Foot and Free London Walking Tours do a whole range of themed tours, covering everything from Jack The Ripper to ghosts and street art.\r\nWhen youâ€™re visiting big attractions, you can often save by booking online, even the day before â€“ London Eye tickets are Â£24.30 as opposed to Â£27 on the day, or the Tower of London is Â£22.70 instead of Â£26.80. If youâ€™re visiting a lot of places, itâ€™s worth investing in a London Pass. They cover over 80 attractions with skip-the-queue access and a free bus tour. There are versions for 1â€“10 days, with or without travel, costing from Â£69 to Â£230 (Â£49â€“Â£194 for children).\r\nIf youâ€™re travelling to London by train, even if itâ€™s just from the suburbs (it has to be on a mainline train though, not the Underground), you can get 2 for 1 entry to London attractions like the London Eye, Tower of London and London Dungeon, plus discounts on restaurants and tours. You need to print out a voucher from the website and bring it with your train ticket.', '2018-10-26 22:50:37', '127.0.0.1'),
(94, 19, 'Kajal-Agarwal-at-London-Photos2.jpg', 'london-tower-bridge.jpg', 'DpHyg5XX4AEWilE.jpg', '', 'thereâ€™s always something going on.', 'One of the benefits of a city as huge as London is that there are loads of free things to see and do.', 'One of the benefits of a city as huge as London is that there are loads of free things to see and do. There are lists and lists of free attractions, museums, spectacles, and what have youâ€”as long as you keep your eyes open.\r\n\r\nThe Tate Modern, National Gallery, Museum of London, and British Museum are allâ€”you guessed itâ€”free! Wander around the beautiful outdoors in Hyde Park, Kensington Gardens, and Hampstead Heath.\r\n\r\nThe Changing the Guard, a fun and historical event that nobody should leave London without seeing, will cost you nothing.\r\nThere are also loads of free events throughout the city. Keep your eyes and ears open for art exhibitions, bookshop readings, and lunchtime concertsâ€”all without a price tag.\r\n\r\nAnd donâ€™t miss East Londonâ€™s street art scene. While Banksy may be Britainâ€™s most famous street art export, there are also a series of street art pieces situated in locations around East London, including the distinctive mushroom sculptures of Christiaan Nagel.\r\n\r\nThe Time Out app is a great resource for local events and festivals. Or you can wander aimlessly in the streets of Londonâ€”thereâ€™s always something going on.\r\nCheap eats are everywhereâ€”be on the lookout for traditional cafÃ©s and delis where you can pick up pre-made sandwiches, as well as food carts.\r\n\r\nDive into English eateries by stopping at Caff, a blue-color diner with simple food. An all-day breakfast costs between Â£3 and Â£5; you can get the fried mashed potatoes and cabbage for just Â£4.\r\n\r\nOn a bright and sunny day, buy a handful of fresh groceries from one of the local markets like Borough Market. Fruits, veggies like celery or carrots, wine, cheese, and a bottle of olives make for the perfect picnic in one of the cityâ€™s many parks.', '2018-10-26 22:55:37', '127.0.0.1'),
(96, 21, '', 'A_white_Marble_stone_Birla_Mandir_Hyderabad_Telangana.jpg', 'Hussain-sagar-lake.jpg', '1540839959maxresdefault (1).jpg', 'When planning a vacation to Hyderabad', 'The city of Hyderabad depicts an interesting confluence of the traditional and the modern, the past and the presen', 'The city of Hyderabad depicts an interesting confluence of the traditional and the modern, the past and the present. When planning a vacation to Hyderabad, chuck all the ideas of a laid-back vacation out from your head and get ready to be on your toes the entire day as with an unending list of tourist attractions, you are bound to have a jam-packed itinerary. Since it is impossible for anyone to soak in the multifarious charms which the city has to offer in a limited time span, we at Holidays DNA have complied a list of the top ten tourist spots which you should certainly not miss, when on a vacation in Hyderabad.\r\n1) Charminar- An iconic landmark of Hyderabad and located in the Old City, it is said to have been built as a charm against a deadly epidemic raging in 1591. Charminar has 45 prayer spaces with foour graceful minarets projected towards the sky.\r\n\r\nGolconda Fort Hyderabad2) Golconda Fort- Capital of the Qutb Shahi kingdom, it is considered by many as one of the most magnificent fortress complexes in India. A Light and Sound show is held in the evenings wherein the glorious past of Golconda Fort is narrated with Golconda depicted full of life, glory and grandeur.\r\n\r\nSalar Jung Museum Hyderabad3)Salar Jung Museum- It houses the largest one-man collection of antiques in the world and is not the typical boring museum as the common understanding of museums is, thereby making its way into one of the most visited tourist spots of Hyderabad\r\n\r\nRamoji Film City Hyderabad4) Ramoji Film City- Constructed over a sprawling 1,666-acre of land, it holds a certification from Guinness World Records of being the largest integrated film city in the world. Escape to Ramoji Film City to enjoy a kaleidoscope of attractions ranging from rolling landscapes, striking gardens, captivating live stunt shows and thrill rides.\r\n\r\nHussain Sagar Lake Hyderabad5) Hussain Sagar Lake- An artificial lake, it forms the boundary between Hyderabad and Secunderabad. At the centre of the lake stands a famous statue of the Buddha, which can be accessed through the various boat rides to it.\r\n\r\nMecca Masjid Hyderabad6) Mecca Masjid- Mecca Masjid is one of the oldest mosques in the city and is at walking distance from Charminar. It has been so named because because the bricks were brought from Mecca to build the central arch of this mosque.\r\n\r\nBirla Mandir Hyderabad7) Birla Mandir- Situated atop a hill and overlooking the Hussain Sagar Lake, it is a magnificient temple of Lord Venkateshwara, built entirely with white marble.It projects the magnificent panoramic view of the twin cuties of Hyderabad and Secunderabad.\r\n\r\nNehru Zoological Park Hyderabad8) Nehru Zoological Park- Inaugarated in 1963, it covers approximately 300 acres of land and is inhabited by more than 1500 species of wildlife. The park also offers elephant rides and safari trips on a daily basis.\r\n\r\nChowmahallah Palace Hyderabad9) Chowmahalla Palace- A popular attraction of Hyderabad, this palace is a blend of many architectural styles and influences. The ceremonial functions of the Nizams were held here.\r\n\r\n10) Paradise Restaurant- Recipient of Best Biryani 2012 Times Food Award, Paradise started as a small cafe, serving tea and snacks. Over time, it has transformed into a palatial restaurant serving delumptious Hyderabadi delicacies. A journey to Hyderabad is incomplete without visiting Paradise restaurant for a traditional Hyderabadi spread', '2018-10-30 00:26:55', '127.0.0.1'),
(97, 21, '15408414681524892037_cp.jpg', '1540841468878336132-612x612.jpg', '1540841468mumbai_afp.jpg', '1540841468406ff6451c2cd9f9f432a71e01b5bd24.jpg', 'â€˜The City of Dreamsâ€™', ' The beautiful and magnificent gate has very well-designed pillars which remain strong till this day. Boating in the Arabian Sea is quite popular in the area, with the starting point being in the vicinity of this architectural marvel.', 'Mumbai is by far the most popular city of India. Such is its recognition, that people within India itself, as well as all over the world, take Mumbai to be the symbol of India. Boasting of a perfect combination of urban development and rich history, this city is known to have something for everybody. Hence, it is no surprise that Mumbai is commonly known as â€˜The City of Dreamsâ€™.  \r\n                      Experiencing a rich influx of tourists all throughout the year, Mumbai offers a mix of everything. From beaches to hills, historical monuments to ultra modern architecture, it has it all. It also boasts of a happening nightlife and a glitzy-glamour filled lifestyle. Therefore, it involuntarily becomes the first stop on the list of places to be visited around the country. It is no surprise at all that you would already know a lot about this city and what is to be seen. However, in case you are having trouble deciding, below is all you need to know about a perfect getaway to this dreamland.\r\n                       Mumbai has a typical subtropical climate. Winter is an unknown identity in these lands. However, it tends to get sticky and humid during the summer months. Hence, it should be avoided during the months of May to June. The rainy season is another time during which it becomes difficult to explore all the areas. Therefore, the best time to visit Mumbai is during the months of September to April.\r\n                          1. Gateway of India â€“ By far the most iconic structure of Mumbai, this archway was built in 1924 during the British rule. The Gateway of India makes for a great first stop for all wanderlust people exploring the city. The beautiful and magnificent gate has very well-designed pillars which remain strong till this day. Boating in the Arabian Sea is quite popular in the area, with the starting point being in the vicinity of this architectural marvel.\r\n2. Marine Drive â€“ This beautiful 3 kilometer long road is famous for having the Arabian Sea all along on one side. The curved shape of this road, combined with the beautiful lighting at night that looks like diamonds, has earned Marine Drive the title of â€˜Queenâ€™s Necklaceâ€™. A drive on this road is surreal and makes you feel as though you are in a different place altogether. The road is lined with a lot of classy eating joints which are very popular all over Mumbai.\r\n             3. Street Markets â€“ Possibly, the greatest crowd pullers in Mumbai are the well-renowned street markets. Out of the many markets lining various streets all over the city, the ones deserving a special mention are â€“ Crawford Market, Colaba Causeway, Linking Road and Fashion Street. They are famous for providing everything that you could dream of. Be it fashionable junk jewellery, stylish clothes, electronic items or even home decor items, these markets have it all.                                                   \r\n                        Temples â€“ Mumbai is also very high on the religious quotient. It boasts of some of the most famous temples all over India. Such is the case that there are special tour package that cover all these spiritual homes. People make it a point to visit these temples and seek the Lordâ€™s blessings. The temples that deserve a special mention are â€“ Siddhivinayak Temple, Mumba Devi Temple and ISKON Temple.\r\n                                         5. Beaches â€“ A beach in the middle of the city, how good does that sound? Well, Mumbai not only makes it sound good, but also look amazing. Populated by thousands of people every day, the Mumbai beaches are a very happening spot. The roadside food stalls, live shows and interactive activities make it a truly memorable experience. The most popular beaches are â€“ Juhu Beach, Aksa Beach and Chowpatty.', '2018-10-30 00:58:20', '127.0.0.1'),
(99, 22, '1541019544W_end_Aug12_pg3_shraddha-travel-family.jpg', '1541019544arc_de_triomphe.jpg', '1541019544paris-evening.jpg', '1541019544W_end_Aug12_pg3_Shraddha-travel-1.jpg', 'MY DECADE-LONG LOVE AFFAIR WITH PARIS PERFECT', 'We love hearing from our guests about their experiences, not only with our apartments, but also their love for Paris.', 'We love hearing from our guests about their experiences, not only with our apartments, but also their love for Paris. Whether the first or fifteenth trip, the excitement for the City of Light is infectious and a reminder of why Paris Perfect was founded. Recently we received a marvelous essay by a long-time guest named Bonnie. A Southerner by birth and choice, sheâ€™s at home working in her gardens when sheâ€™s not daydreaming of Paris. Read on to learn more about Bonnieâ€™s decade-long love affair with Paris Perfect.\nIt all started shortly after that day so many years agoâ€“9/11. In an effort to calm our collective anxiety, I remember clearly the president saying, â€œGo out and live your lives; spend money; donâ€™t live in fear.â€ I wanted to help in some small way, so I took him at his word. I brought a brand new car and booked a trip to Paris. You should know that I had not previously owned a brand new car, nor had I ever been to Paris, even though the city kept popping up in my daydreams.\n\nI booked a room in a small, but charming, boutique hotel in the Latin Quarter. The room was only slightly bigger than the two twin beds shoved together in the middle of the room. One had to either walk sideways like a crab or crawl over the bed to get to the bathroom. Right then and there I thought to myselfâ€“there has to be a better option. Considering this was my first time in Paris, I did all the touristy things.\nI hurtled myself thru the Metro tunnels from corner-to-corner, but didnâ€™t really see the city. True, I emerged into the sunlight approximately in the places I hoped to be. And except for frequent, yet-to-be-explained train delays, it was quick, but there had to be another way to get around Paris.\n\nBecause I spent the better part of that first trip frantically visiting the Louvre with its unbelievably long lines, the Musee dâ€™Orsay, la Orangerie, the Eiffel Tower with its wicked winds and hellish lines, Montmartre, Versailles, Giverney, Invalides and the tomb of Napoleon, I never realized there were buses trundling along in the sunshine. Riding the bus would have elevated me out of the Metro darkness and afforded me to see the city and learn its layout.\nBecause I ate breakfast in the hotel every morning, paying dearly for my morning cup of coffee and croissant, I never noticed that there were real bakeries that I could buy my breakfast. (I must say that not only did I learn to shop for breakfast, but also that itâ€™s twice as nice to return later in the day for a post-dinner treat.)\n\nThe first trip turned out OK. I twirled around in delight on Pont des Arts and threw my cloche hat in the air Ã  la Mary Tyler Moore. Though, I never once shopped for food or ventured away from my hectic itinerary. I was deeply and profoundly exhausted when I returned home, and in those days, back to work. Still, as soon as I was home, I could think of nothing else but going back to Paris.\n\nIt took a few years before I would return. My parents died, followed by my brother. When it was time for me to return, I found, like some magic spell, the Paris Perfect website. From the very first time I clicked on it, I was wholly and unquestionably in love. The idea of going to Paris and staying in an apartment was revolutionary in the truest sense of the word. The guest reviews were glowing; the properties were inviting; the tours seemed to offer hope that I could go and not return in a zombie-like state.\nSo I booked my first apartment. It was the gorgeous Sancerre, with itâ€™s five sets of French doors that allowed light to flood the apartment. They revealed the happy street sights below, not to mention the view of la Tour Eiffel.\n\nParis Perfect Tours taught me to relax and let them help me avoid the long lines I found at Notre Dame with their skip-the-line tours. Paris Perfect Tours taught me that there are lovely, less-crowded museums all over Paris, many of which feature memorable dining opportunities.\n\nOne trip, with help from Paris Perfect Tours, I hired a car and driver that took my two brothers and me through the Normandy countryside. We saw the World War II landing sites, American Cemetery and museum at Caen. It was a day I will never forget. Just like Arlington National Cemetery, I think all Americans should have the chance to spend the day there. You will understand the price of freedom if you do.', '2018-11-01 02:29:04', '127.0.0.1'),
